class CustomAuth extends BaseAuth {
  async validate() {
    // ...
    const authenticator = this.authenticator as AuthModel;
    this.authenticator.findUser(); // \u67E5\u8BE2\u7528\u6237
    this.authenticator.newUser(); // \u521B\u5EFA\u65B0\u7528\u6237
    this.authenticator.findOrCreateUser(); // \u67E5\u8BE2\u6216\u521B\u5EFA\u65B0\u7528\u6237
    // ...
  }
}
